message:
Os arquivos históricos acima nos mostram que: 

1. Não houve golpe em 64; mas um planejamento de contra golpe em clara manifestação popular desde 1962;

2. O movimento esquerdista de Jango tentou tomar o Palácio da Guanabara, mas foram repelidos pelas tropas que defenderam o povo. No Palácio, até senhoras portavam metralhadoras;

3. O Congresso empossou o presidente da Câmara até as próximas eleições;

4. As Forças Armadas souberam  sufocar a influência comunista em parte da tropa, que já planejava uma intentona e assassinatos dos comandantes; 

5. As Forças Armadas brasileiras são uma elite militar democrática em relação a muitos exércitos no mundo que não souberam proteger o povo e o território;

6. O Bolsonaro sabe o que está pedindo ao povo: - somente o povo e as FA podem salvar o Brasil. 

Gideão.

OMS se desculpa por controvérsias em pesquisas sobre hidroxicloroquina. 🤡🤦🏼‍♀️👇🏻👀

